$(function() {
    pdfMake.fonts = {
        cabin: {
            normal: 'Cabin-Regular.ttf',
            bold: 'Cabin-Bold.ttf',
            italics: 'Cabin-Italics.ttf'
        },
        nahi: {
            normal: 'nahi-font.ttf'
        }
    }

    var openSelectedPDF = function(doc, name) {
        console.time(name);
        var pdf = pdfMake.createPdf(doc);

        pdf.getBuffer(function(result){
            var blob = new window.Blob([result], {type: 'application/pdf'});
            window.URL = window.URL || window.webkitURL;
            var url = window.URL.createObjectURL(blob);
            window.open(url);
            console.timeEnd(name);
        });
    }

    $('.fast').click(function() {
        var doc = fastDoc;
        openSelectedPDF(doc, 'fast-doc');
    });

    $('.slow').click(function() {
        var doc = slowDoc;
        openSelectedPDF(doc, 'slow-doc');
    });    
});
